INSERT INTO `wp_postmeta` VALUES('10618', '4275', 'vsc_testimonial_desc', '<div class=\"col-xs-12 col-sm-4 wrap\">\r\n<img src=\"http://demo4.wodebox.com/wp-content/uploads/2016/07/logo-mediaV.png\">\r\n<div>\r\n<span class=\"testimonial-name base_clr_txt\">Media V</span>\r\n<span class=\"testimonial-position\">Qingmu Yu</span></div>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-8 wrap\">\r\n<blockquote>\r\nRay is an insightful, intelligent, and detail-oriented investor. He offered valuable help before and after investing in my company. Our partnership is delightful.\r\n </blockquote></div>');
