INSERT INTO `wp_postmeta` VALUES('10639', '4280', 'vsc_testimonial_desc', '<div class=\"col-xs-12 col-sm-4 wrap\">\r\n<img src=\"http://demo4.wodebox.com/wp-content/uploads/2016/07/logo-wandoujia.pngg\">\r\n<div><span class=\"testimonial-name base_clr_txt\">wandoujia</span><span class=\"testimonial-position\">Wandoujia</span></div>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-8 wrap\">\r\n<blockquote>While Wandoujia was still a tiny team working in an apartment in 2011, Boyu saw our potential and pushed his firm to lead our Series A round, and, in the following years, spent lots of time assisting us with all sorts of growing pains with great patience and care.</blockquote></div>');
INSERT INTO `wp_postmeta` VALUES('10640', '4279', 'vsc_testimonial_details', 'qunar');
INSERT INTO `wp_postmeta` VALUES('10641', '4279', 'vsc_testimonial_desc', '<div class=\"col-xs-12 col-sm-4 wrap\">\r\n<img src=\"http://demo4.wodebox.com/wp-content/uploads/2016/07/logo-qunar.png\">\r\n<div><span class=\"testimonial-name base_clr_txt\">Qunar</span><span class=\"testimonial-position\">CC Zhuang</span></div>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-8 wrap\">\r\n<blockquote>\r\nRay is very good at communicating with entrepreneurs. As an investor, he has unique insights for fast-growing companies’ opportunities and challenges.\r\n </blockquote></div>');
INSERT INTO `wp_postmeta` VALUES('10642', '4278', 'vsc_testimonial_details', 'Meilishuo');
INSERT INTO `wp_postmeta` VALUES('10643', '4278', 'vsc_testimonial_desc', '<div class=\"col-xs-12 col-sm-4 wrap\">\r\n<img src=\"http://demo4.wodebox.com/wp-content/uploads/2016/07/logo-meilishuo.png\">\r\n<div>\r\n<span class=\"testimonial-name base_clr_txt\">Meilishuo</span>\r\n<span class=\"testimonial-position\">Xu Yirong</span></div>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-8 wrap\">\r\n<blockquote>\r\nRay is one of the most insightful investors I’ve met. His understanding and wisdom added significant value to Meilishuo’s growth. I appreciated his help along the way and wish Blue Lake success.\r\n </blockquote></div>');
